Batch ReadFor relatively small amounts of data, or for data that has undergone projection and filtering,
you can directly use a standalone program to read the table data.But if the data volume of the table is relatively large, you can distribute splits to different tasks for reading.The reading is divided into two stages:Scan Plan: Generate plan splits in a global node ('Coordinator', or named 'Driver').Read Split: Read split in distributed tasks.import org.apache.paimon.data.InternalRow;
import org.apache.paimon.reader.RecordReader;
import org.apache.paimon.table.source.ReadBuilder;
import org.apache.paimon.table.source.Split;
import org.apache.paimon.table.source.TableRead;

import java.io.IOException;
import java.util.List;

public class ReadTable {

    public static void main(String[] args) {
        // 1. Create a ReadBuilder and push filter (`withFilter`)
        // and projection (`withProjection`) if necessary
        ReadBuilder readBuilder = table.newReadBuilder()
                .withProjection(projection)
                .withFilter(filter);

        // 2. Plan splits in 'Coordinator' (or named 'Driver')
        List<Split> splits = readBuilder.newScan().plan().splits();

        // 3. Distribute these splits to different tasks

        // 4. Read a split in task
        TableRead read = readBuilder.newRead();
        RecordReader<InternalRow> reader = read.createReader(splits);
        reader.forEachRemaining(ReadTable::readRow);
    }
}

Batch WriteThe writing is divided into two stages:Write records: Write records in distributed tasks, generate commit messages.Commit: Collect all CommitMessages, commit them in a global node ('Coordinator', or named 'Driver', or named 'Committer').import java.util.List;

